import React, { Component } from 'react'

export class MenuDesp extends Component {
    render() {
        return (
            <div>
                <Link to="/Portales">Prtales</Link><br />
                <Link to="/RestBlocks">RestBlocks</Link><br />
                <Link to="/Circulos">Circulos</Link><br />
            </div>
        )
    }
}

export default MenuDesp
